-- Create stored procedure to add an agenda item
CREATE PROCEDURE addAgendaItem
    @StartTime datetime,
    @EndTime datetime,
    @Room nvarchar(100),
    @SessionId int
AS

-- Create stored procedure to add a session
CREATE PROCEDURE addSession
    @Title nvarchar(max),
    @Description nvarchar(max),
    @SessionType nvarchar(50),
    @Level nvarchar(50),
    @Duration int,
    @SpeakerId int
AS

-- Create stored procedure to add a speaker
CREATE PROCEDURE addSpeaker
    @FirstName nvarchar(100),
    @LastName nvarchar(100),
    @Title nvarchar(200),
    @Email nvarchar(max),
    @Bio nvarchar(max),
    @PhotoUrl nvarchar(400),
    @TwitterHandle nvarchar(50),
    @LinkedInProfile nvarchar(400),
    @GitHubProfile nvarchar(400),
    @Website nvarchar(400)
AS

